import axios from 'axios';
import React, { Component, useState } from 'react'
import { Link, useNavigate } from 'react-router-dom';

const PostRouteDetails = () => {
    const navigate = useNavigate()

    const [postRouteDetails, setPostRouteDetails] = useState({

    })

    const changeHandler = (e) => {
        setPostRouteDetails(prev => ({ ...prev, [e.target.name]: e.target.value }))
    }

    const clickHandler = (e) => {
        e.preventDefault();

        axios.post("http://localhost:8080/admin/route-details/post", this.state)
            .then(
                response => {
                    navigate('/')
                }
            ).catch(
                error => {
                    console.log(error)
                }
            )
    }



    const { routeId, stationId, time } = this.state
    return (
        <div className='stylefrom'>
            <div className='forms' >
                <form>
                    <h3>Add Route Details</h3>
                    <div >
                        <label htmlFor='text'>routeId</label><br></br>
                        <input type={"text"} placeholder="route Id.." name='routeId' value={routeId} onChange={this.changeHandler} required ></input><br></br><br></br>
                    </div>
                    <div >
                        <label htmlFor='text'>Station Id</label><br></br>
                        <input type={"text"} placeholder="station Id.." name='stationId' value={stationId} onChange={this.changeHandler} required ></input><br></br><br></br>
                    </div>
                    <div >
                        <label htmlFor='text'>Arraival Time</label><br></br>
                        <input type={"text"} placeholder="HH:mm:ss" name='time' value={time} onChange={changeHandler} required ></input><br></br><br></br>
                    </div>
                    <div>
                        <button onClick={this.clickHandler}>-Add-</button><br></br><br />
                    </div>
                    <div>
                        <Link to={"/timeschedule"}> Back</Link>
                    </div>
                </form>
            </div>
        </div>
    )
}


export default PostRouteDetails
